import { makeObservable, observable } from "mobx";

export default class ActivityStore {
    title = 'Hello from MobX!';

    constructor() {
        makeObservable(this, {
            title: observable
        })
    }  

    setTitle() {
        this.title = this.title + '!';
    }
}
